import 'dart:convert';
import 'package:flutter_test/flutter_test.dart';
import 'package:frontend_android_ciudadano/api/vehicle_repository_api.dart';
import 'package:frontend_android_ciudadano/entities/car.dart';
import 'package:http/http.dart' as http;
import 'package:mockito/mockito.dart';

class MockClient extends Mock implements http.Client {}

void main() {
  group('VehicleRepositoryApi', () {
    final mockClient = MockClient();
    final repository = VehicleRepositoryApi(
        mockClient, 'https://parqueatebiendemo.azurewebsites.net');

    test(
        'fetchVehicleDetails returns a Car if the http call completes successfully',
        () async {
      final responseJson = {
        'LicensePlate': 'A123489',
        'VehicleType': 'Motor',
        'VehicleColor': 'Azul',
        'CurrentAddress': 'Santiago',
        'Status': 'Reportado',
        'ReportedDate': '6/18/2024 8:15 PM',
        'Photos': [
          {
            "FileType": "data:image/jpeg;base64,",
            "File":
                ""
          },
          {
            "FileType": "data:image/jpeg;base64,",
            "File":
                ""
          },
          {
            "FileType": "data:image/jpeg;base64,",
            "File":
                ""
          }
        ]
      };

      final uri = Uri.parse(
          'https://parqueatebiendemo.azurewebsites.net/ciudadanos/A123489');
      when(mockClient.get(uri)).thenAnswer(
          (_) async => http.Response(jsonEncode(responseJson), 200));

      final car = await repository.fetchVehicleDetails('A123489');

      expect(car, isA<Car>());
      expect(car.licensePlate, 'A123489');
    });

    test(
        'fetchVehicleDetails throws an exception if the http call completes with an error',
        () async {
      final uri = Uri.parse(
          'https://parqueatebiendemo.azurewebsites.net/ciudadanos/A123490');
      when(mockClient.get(uri))
          .thenAnswer((_) async => http.Response('Not Found', 404));

      expect(() async => await repository.fetchVehicleDetails('A123490'),
          throwsException);
    });
  });
}
